40	Bendtner - I’m a different person now	Nicklas Bendtner says the birth of his son has had a profound impact on his life and has caused him to “change a lot”.\r\nThe Denmark international has spent the previous two seasons out on loan, at Sunderland and Juventus respectively, but is back in the Arsenal squad this term.\r\n\nBendtner exclusive\n\n The 25-year-old believes he is a different person now and puts this down to becoming a father and his experiences away from the Club.\r\n“First of all I had a baby, which changed me a lot,” Bendtner told Arsenal Player. “I think a lot of people say that you have babies and they change you but for me I could really feel a big difference to my life.\r\n“Being abroad showed me a lot of different things and different aspects of how to live and how to cope with problems and things like that. I think that has given me a lot more as a man.”\r\nBendtner insists that the wider perception of him is wrong, and feels that some of his previous statements have been misinterpreted.\r\n“I don't like that I keep getting put up on comments I've made which have been wrongly said - that I still to this day have to see it and listen to it,” he said.\r\n“If people don't like me, that's fair enough. If people can't accept that sometimes you're young and make mistakes and move on, that's not up to me.\r\n“I try to do my best and that's basically all I can do for my family and my friends and everyone around the Club.\r\n\r\n\r\nBeing abroad showed me a lot of different things and different aspects of how to live and how to cope with problems and things like that\r\nNicklas Bendtner\r\n\r\n“I think every football player wants to achieve the [most] within what he can do. That’s what makes you. If you have a dream and try to do everything you can to be the best that you can, that's you trying to make the best out of your job or what you do.\r\n“I basically said that I think that anybody who plays football in the world would love to be the best. I think that's a normal statement and that got [changed] to me saying that I was the best player in the world.\r\n“I don't know where that came from. I still listen to it now and again and still see it. If people want to believe that, then that's that.”\n\nRob Kelly\n\n9 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/5530912a71eaacb88fa130465a51e847/552x310/idx-3.jpg	2013-10-10 13:21:06.015434	2013-10-10 13:21:06.015434
41	Ramsey and Wenger win awards	Aaron Ramsey and Arsène Wenger have been named the Barclays Player of the Month and Barclays Manager of the Month respectively.\r\nIn-form Ramsey scored five times in five appearances in September, including a brace at Sunderland, and cemented his place in a competitive Arsenal midfield.\r\nWenger presided over a perfect month for Arsenal with six wins in six matches - including a penalty shoot-out victory at West Bromwich Albion in the Capital One Cup.\r\nThe winning run took Arsenal to the top of the Premier League and their Champions League group.\r\nScroll down for our picture gallery featuring Ramsey and Wenger receiving their Barclays awards.\r\n\n\n\n\n\n\n\n\n\nRamsey and Wenger receive Barclays award\n\nTo buy official Arsenal pictures visit Arsenal Pics\n\nArsenal Pics\n\n8 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/b5af079b23e7dac6dbecd249b568caf1/552x310/idx-2.jpg	2013-10-10 13:21:06.187055	2013-10-10 13:21:06.187055
42	Flamini - This is a welcome break for us	Mathieu Flamini thinks the upcoming internationals will provide a timely respite for Arsenal ahead of a busy winter schedule.\r\nThe Gunners' five-game winning streak in the league came to an end on Sunday with a 1-1 draw at West Bromwich Albion.\r\nFlamini, named man of the match by Arsenal's Twitter followers, will now recharge his batteries - and he's not the only one.\r\n\r\n\r\nFor us it is a chance to have players coming back into the group like maybe Theo [Walcott] and Santi [Cazorla]\r\n\r\n\r\n"I think it [the break] comes at a really good time because we have played a lot," said Flamini. "Obviously everybody is tired physically and tired mentally because you have to give 200 per cent in every single game.\r\n"For us it is a chance to have players coming back into the group like maybe Theo [Walcott] and Santi [Cazorla]. I hope everyone will be back soon."\r\nThe 29-year-old put in another battling display at the Hawthorns and has nailed down a spot at the heart of Arsenal's midfield since his return. And Flamini does not think the physical demands of the Premier League have changed since he left England in 2008.\r\n"I don’t think it is harder - the Premier League was very hard before and it is still as hard as before," he said. "Top players were playing in the Premier League before and top players are still playing in the Premier League now. That means it's very physical and very quick from one side to another.\r\n"The transition from the defence to the attack is very quick. We have a lot of space also and of course for me it is the most difficult championship. We can see that every time on the pitch."\n\nIsaac Moore\n\n7 Oct 2013\n\n	http://www.arsenal.com/assets/_files/scaled/696x392/oct_13/gun__1380898658_flamini_1.jpg	2013-10-10 13:21:06.237297	2013-10-10 13:21:06.237297
43	Szczesny - Let's start a new run now	Wojciech Szczesny believes Sunday's result at West Bromwich Albion will eventually be seen as a point gained, rather than two dropped.\r\nThe Polish goalkeeper was disappointed to see Arsenal's winning streak end at the Hawthorns but he had to be at his best to deny Albion a second goal in the second half and also made a stunning save when the game was goalless.\r\n"I suppose when we come down a little bit we'll be happy with that point," Szczesny told Arsenal Player. "I was disappointed after the game because we felt confident, we had the momentum. It was a tough game so we'll probably take it. But I'm still disappointed."\r\n\r\n\r\nHopefully we can win the next game and the few more after that, and create the momentum again. We're still top of the league so the momentum is still with us. We won't lose our confidence\r\n\r\n\r\nArsenal go into the international break at the top of the Premier League table and Szczesny wants them to start another winning streak when they return to action against Norwich City on October 19.\r\n"It's time for us to start a new run," he said. "Hopefully we can win the next game and the few more after that, and create the momentum again. We're still top of the league so the momentum is still with us. We won't lose our confidence.\r\n"We said to ourselves before the game that we want to go into the break top of the league. Obviously we would have preferred to have done it with a win but we got a point which was enough to keep us on top."\n\nChris Harris\n\n7 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/6611d016c1b47ab798e21bc872d133e0/552x310/idx-3.jpg	2013-10-10 13:21:06.2847	2013-10-10 13:21:06.2847
44	Arteta - We'll know more after 10 games	Mikel Arteta believes the Premier League table will start to take shape after 10 games.\r\nArsenal returned to the top of the Premier League on Sunday after Jack Wilshere's second-half strike secured a point away to West Bromwich Albion.\r\n\r\n\r\nThat's what makes this league the most entertaining in Europe so we know how tough it's going to be\r\nMikel Arteta\r\n\r\nBut the Spanish midfielder said it will take a little longer for teams to get a better idea of what "level" they are at this season.\r\n"After 10 games most of the teams have played against most of the teams," Arteta told Arsenal Player. "You know where you are and you know your level. You have played against teams at the top and teams at the bottom as well. But at the moment the league looks good.\r\n"It's going to be tough. There are five or six teams challenging to win it so you are not depending on one or two results.\r\n"That's what makes this league the most entertaining in Europe so we know how tough it's going to be. But we are on a good run and we are confident with the players we have."\r\nArteta has started the Gunners' last two games after missing the start of the season with a thigh injury and the 31-year-old said he is delighted to be back.\r\n"It was frustrating to be out of the side because I worked so hard in pre-season and then I got injured. Psychologically it was hard to take. But I worked hard because they weren't expecting me back for six to eight weeks and I made it back in five so I was really happy."\n\nIsaac Moore\n\n7 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/277ea05ce174a846227ccad2d0e87689/552x310/idx-5.jpg	2013-10-10 13:21:07.429331	2013-10-10 13:21:07.429331
45	Wenger - Point vital for confidence	Arsène Wenger says it was vital for Arsenal to go into the international break at the top of the table.\r\nJack Wilshere's second-half strike earned the Gunners a 1-1 draw at West Bromwich Albion, allowing them to leapfrog Liverpool and return to the Premier League summit.\r\nSunday's game was notable for Arsenal conceding the first goal for the first time this season. Wenger was pleased with his team's response.\r\n"It was a big test for us," he told Arsenal Player. "You could see that we had to dig deep to come back. We have given a lot recently and I'm happy that we didn't lose the game, even if of course there are always some regrets when you don't win.\r\n"It was a hard-fought point in a difficult game. I felt that in the first half we had problems to find our pacy game. In the second half we came back to 1-1. Overall we have shown character, spirit and a determined attitude until the end. Both teams wanted to win it, it was an interesting game.\r\n"It's vital that the confidence [from being top] remains there and that you feel that we don't lose. This place [The Hawthorns] can be difficult for anybody so let's have a break, come back and win again."\n\nChris Harris\n\n7 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/3aec7b83e0308f6a946115ccd8f83caf/552x310/idx-3.jpg	2013-10-10 13:21:07.49034	2013-10-10 13:21:07.49034
46	Wilshere on drawing, scoring and smoking	Jack Wilshere spoke to Arsenal Player after Sunday's 1-1 draw with West Bromwich Albion.\r\nYou can watch a video of his interview by clicking the play button above. Read on for a transcript of what he said.\r\non the importance of the comeback against West Brom…It was a big point. You don't want to be going into the international break after a loss and you have time to think about it. It was a good point and it's a tough place to come. Especially when you are 1-0 down going into the last 30 minutes. Even at the end we though we could nick it but we played well and we'll take the positives.\r\non staying top…There's no easy game in the Premier League and as you can see Tottenham lost at home. Big teams are losing and we've won a few games now so people are thinking we're going to win this one or we're going to win that one, but it wasn't easy today. I think at the end of the season we'll look back at it and think it was a good point.\r\non going almost three years without a league goal…I've played a lot of games and sometimes I get into the positions and miss but it was nice to get one today. I had a chance just before where I put it over, I didn't really see it to be honest. I was lucky to get into another position and it was a good strike.\r\non the character the team showed…People have said we've lacked that in the past few years but we gained last season where we had to win games and we've continued that this season. We've added a few more top-quality players and we are starting to look good now. We have to get that winning mentality.\r\non the squad depth when everyone returns…We added a few players last year and they've settled in really well. Olivier Giroud has had a fantastic season so far and we've still got Santi [Cazorla] to come back and Mesut [Ozil] seems to have fitted in straight away so we're looking strong at the minute. We have to keep everyone fit and then we will have a really good squad to choose from.\r\non Ozil's part in his goal…I think when you watch him press you can tell that he's played for a top team and he's been taught how to defend properly. I think you really notice that about him and hopefully we can learn off him on when to press and when not to. He's been at a big club and he's got that experience so he's great for us.\r\non his reaction to the smoking pictures…I made a mistake. Players make mistakes, I'm not a smoker. I spoke with the boss, he asked me what happened and I explained to him and we sorted it out. He put me in the team today and hopefully I repaid him.\r\non England's vital upcoming World Cup qualifiers…They are two big games. We expect to win our home games at Wembley but don't get me wrong they are not going to be easy. International football is tough as I found out in the last game. I think we need three or four points from two games and we'll be alright. We've got a good squad so hopefully we can all get together and make it happen.\r\non fighting for England…Of course. There is no better feeling for an Englishman than to play for his country. It's a proud moment every time I pull on that shirt and if I'm selected I'll do my best.\n\n7 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/68216ebbc2c57395030486c50b52973c/552x310/idx-7.jpg	2013-10-10 13:21:07.598755	2013-10-10 13:21:07.598755
47	Wenger on Wilshere and staying top 	Arsène Wenger spoke to the media after Sunday's 1-1 draw at West Brom. Read on for a transcript of what he said: \r\non whether he was pleased with a point…Pleased? No because I want to win but if you ask me if it was a fair point over the 90 minutes I would say yes. Why? Because we were 1-0 down just before half-time and straight after half-time Anelka misses a chance for 2-0 and that would have made it difficult. After that I have some regrets because when we came back to 1-1 in the last half an hour we had the chances to score a second goal but we have shown spirit to come back and we did give it our all until the end to try to win.\r\nBut they did as well and they have many players who can provoke one against one on the break and run with the ball so they made it difficult for us and they defended very well. West Brom confirmed today why they won at Manchester United because they have good pace in every position and they have a huge squad. When you think today Anichebe was not there and they had Long and Morrsion on the bench. Dorrans was not in the squad so they have a massive squad of quality players.\r\non showing resilience after not scoring the first goal…It did require special resilience because they didn't give us any space, they were well organised and we needed find something special to score.\r\non Wilshere scoring his first league goal since November 2010…At least that is done now but he had a difficult first half where he was fouled a lot but he has shown that he has character and kept going until the end. It's good that he was rewarded.\r\non Wilshere being fouled a lot…He was pushed over a lot. I don't think there was any dirty fouls on him but he was pushed a lot and didn't get the fouls. I think in the second half he gave some great balls to score where we had chances. Overall he he had a very good second half.\r\non speaking to Wilshere before the game..No, he is an honest guy and when he is wrong he knows it. I think today the players don't get away with anything. We got away with it a bit more but they know that's the rules of the modern game. They have to deal with it and I think he learns very quickly. What is more interesting for him and for Arsenal is that he shows the right response on the pitch.\r\non Wilshere's honesty about his goalscoring form…I don't think he will ever be a goalscorer but he is a player who can create chances for others. In our job it's quite simple, you need players who score and players who give the ball to those who score. He is more in the second category than the first. But of course from the second category you want a few goals so it's good that he knows he can score goals. Let's not forget that we had the same problem with Ramsey a while ago and suddenly once they start to score it comes naturally.\r\non going into the international break top…I feel it was important not to lose once we were down today and that is the most important thing. For the mental comfort it's good to remain top after two away games.\r\non being light on the bench without Cazorla and Walcott…We have lost games away from home with all of our players available so ideally you want everybody back and available. I can't complain because today I had Rosicky, Gnabry who scored last week, Bendtner, Vermaelen and Monreal all on the bench so we have quality.\r\non having the mentality of champions…A mentality of being champions is built up through the season and I believe that we continue to focus on the way we want to play. We have desire, we have the spirit but we are only in October, in March and April you can show that you have the mentality of champions but at the moment it's early and it's good to continue our run.\n\n6 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/cd5768d9d185138fcdcb347b840da269/552x310/idx-5.jpg	2013-10-10 13:21:07.8906	2013-10-10 13:21:07.8906
48	TEAM NEWS: Wenger makes two changes	Arsène Wenger has made two changes to the side that beat Napoli for Sunday's Premier League game at West Brom. \r\nCarl Jenkinson replaces the injured Bacary Sagna and Jack Wilshere is preferred to Tomas Rosicky in midfield. \r\nMikel Arteta skippers the team as the Gunners look for their ninth straight away win in the league.\r\nTeam in full: Szczesny, Jenkinson, Koscielny, Mertesacker, Gibbs, Flamini, Arteta, Wilshere, Ramsey, Ozil, Giroud. \r\nSubs: Fabianski, Monreal, Vermaelen, Rosicky, Ryo, Gnabry, Bendtner. \n\n6 Oct 2013\n\n	http://www.arsenal.com/assets/_files/scaled/696x392/jul_13/gun__1374224655_jenkinson_vietnam.jpg	2013-10-10 13:21:07.976847	2013-10-10 13:21:07.976847
49	Flamini - The players trust each other	Mathieu Flamini says "solidarity" has been the key to Arsenal's early-season success.\r\nThe French midfielder has been one of the driving forces behind the Gunners' 10-match winning streak after returning to the Club in the summer.\r\nArsène Wenger's squad was questioned after starting the campaign with a home defeat against Aston Villa, but Flamini was always confident that they would prove their doubters wrong.\r\n"Many people were talking outside of the Club but from the inside we knew we had a lot of qualities," he said. "We had a difficult period but the manager never changed his philosophy and believed very strongly in this team. I’m really happy he has proved what he did was the right thing.\r\n\r\n\r\nTechnique, once you have it, you have it. But solidarity, you have to work on it\r\n\r\n\r\n"We are trusting each other. This is the result of a lot of work. Trust is very important. The main thing is to have quality in the team but after that you need to find team spirit.\r\n"When you start helping each other, fighting for each other on the pitch, this helps you to win games. Especially during a difficult period, it helps you to stay focused, be a unit, and go from a bad period to a good period.\r\n"Team spirit is difficult to find, and difficult to keep, so we have to work very hard on that. What makes the difference is the solidarity in the team. Technique, once you have it, you have it. But solidarity, you have to work on it."\r\nThe arrival of Flamini was overshadowed by the club record signing of Mesut Ozil from Real Madrid. But the Frenchman has emerged as a vital cog in the Arsenal machine.\r\n"I am not a striker, I am a defensive midfielder, protecting the defence, trying to find the best balance in the team between the defence and attack," said Flamini.\r\n"That’s very important. For a team to be strong defensively makes all the difference. If you want to win titles, if you want to travel anywhere, you have to be strong defensively. With the qualities we have in the team I am sure we will score goals anywhere.\r\n"Defensive work is maybe a bit more difficult to see than when you score or make an assist. But it’s very important as part of the balance of the team. Winning games is a quality of effort. It’s teamwork. I am trying to do my best for the team.\r\n"The back four do a lot of work so I am trying to protect my defence to the maximum."\n\nChris Harris\n\n5 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/f9253551d0736392ef493c9ee1852e4c/552x310/idx-20.jpg	2013-10-10 13:21:08.011481	2013-10-10 13:21:08.011481
54	Wenger - Szczesny influence is important	Arsène Wenger believes Wojciech Szczesny played an important part in Arsenal's last two games.\r\nThe 23-year-old keeper was a spectator for the majority of the Napoli game on Tuesday but dealt with some dangerous crosses late on, days after making a number of notable saves during the league win over Swansea.\r\n\r\n\r\nIt sometimes has a psychological impact on an opposing team when a goalkeeper comes to claim a cross or is quick off his line.\r\nArsène Wenger \r\n\r\nWenger thinks the added competition for the No 1 shirt this season has seen an improvement in the Pole's form.\r\n"He comes off the line much more to claim the ball," Wenger told Arsenal Player. "His movement to take the ball at the peak is much better and he has shown that especially in the last two games against Swansea and Napoli when it was needed to come off the line and take a cross.\r\n"It sometimes has a psychological impact on an opposing team when a goalkeeper comes to claim a cross or is quick off his line."\r\nSzczesny recently admitted it's his "obsession" to keep clean sheets and Wenger was pleased he got one in the 2-0 win over Napoli.\r\n"He got one and I can understand that because as a goalkeeper you always think you are doing your job well when you have a clean sheet. It's the same for defenders as well."\n\nIsaac Moore\n\n3 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/74b00d695ea6c2a59534067885b61788/552x310/idx-1.jpg	2013-10-10 13:21:08.662928	2013-10-10 13:21:08.662928
55	'We play better in positive environment'	Arsène Wenger has called for "perspective" amid Arsenal's strong start to the season - but he admits his players are thriving in the feelgood factor around the Club.\r\nThe Gunners have reeled off 10 straights wins since the opening day of the season and sit top of the Premier League and their Champions League group.\r\nInevitably, talk has turned to Arsenal's trophy prospects and Wenger is keen to dampen the hype so early in the campaign. Nonetheless, he thinks the change in mood among the fans has had a knock-on effect.\r\n\r\n\r\nWe played in a sceptical environment last year and that does not create a great level of confidence. What has changed recently for sure is that our environment is positive, our fans believe in us again\r\n\r\n\r\n"What is positive is that the team plays better when the environment is positive," Wenger told Arsenal Player.\r\n"We played in a sceptical environment last year and that does not create a great level of confidence. What has changed recently for sure is that our environment is positive, our fans believe in us again.\r\n"That of course is very important if we want to be successful, if you feel your fans believe in you and they think that you are good. I've said many times that I feel it's important for the team to feel that the fans stand behind the team.\r\n"On my side, my job I see the other way - it's not for the fans to make me happy, it's my job to make the fans happy. I feel I do that if they stand behind the team, because that gives you the feeling that they have done something right."\r\nNonetheless, Wenger is not ready to entertain thoughts of winning the title after just six games of the Premier League season.\r\n"What is important is to put that all into perspective and you know that it's the hype around the game," he said.\r\n"It's positive because it shows the huge interest but as well people tend to judge the moment as the definitive situation but you know it's just a photo of the situation, of the moment you talk.\r\n"We want of course to win trophies but that is all to do. The only way we have a chance to do it is to try to focus on the way we play."\n\nChris Harris\n\n3 Oct 2013\n\n	http://player.arsenal.com/site_media/images/uploaded/videothumbs/8a93b67f80c67541e96b68ab1b8bff8c/552x310/idx-5.jpg	2013-10-10 13:21:08.703776	2013-10-10 13:21:08.703776
56	Pires - Ozil reminds me of Zidane	Arsenal legend Robert Pires has likened Mesut Ozil to French great Zinedine Zidane.\r\nThe Germany international has settled seamlessly in north London after signing from Real Madrid on transfer deadline day, opening his account for the Club against Napoli and laying on five other goals.\r\nPires has no doubts that Ozil will be a major success at Emirates Stadium and believes that the signing represents a real statement of intent.\r\n\r\n\r\nIt will give the rest of the squad more confidence and opponents will fear Arsenal again\r\nRobert Pires\r\n\r\n"I think that Arsène Wenger and Arsenal have signed a world class player in Mesut Ozil," Pires told the official Arsenal Magazine.\r\n"He is, in my opinion, the best No 10 in Europe. He has proven it with Real Madrid and with Germany. For me, he is exactly the player the team was missing.\r\n"It is an amazing coup that Arsenal made this summer not only in football terms as Ozil will strengthen the team, but it will give the rest of the squad more confidence and opponents will fear Arsenal again. But also in terms of prestige as it proves that Arsenal is still a massive club.\r\n"If I had to compare Ozil with someone I played with in my career, I think I would say that he has a bit of Zinedine Zidane in him, in terms of vision, touch and genius to make others play around him.\r\n"Like all Arsenal fans who have been expecting a big signing like that for a number of years, I am very happy he is a Gunner now because he will be fantastic for us."\r\nRobert was speaking exclusively to the October edition of the official monthly magazine - still available at newsagents, by visiting www.arsenal.com/magazine or by calling 0845 301 7626\n\nNik Brumsack\n\n10 Oct 2013\n\n	http://www.arsenal.com/assets/_files/scaled/696x392/sep_13/gun__1379680578_magoct.jpg	2013-10-10 22:13:48.027975	2013-10-10 22:13:48.027975
